■92L　【WADING COMMANDER】<br><br> 

軽さと感度を追求し、可変ファストテーパーを採用することで操作性を高めたスーパーオールラウンダー。特に河川や干潟のウェーディングにおいて威力を発揮。
12cm～14cmのミノーや20gクラスのバイブレーションを正確なコントロールでロングキャストし、回遊するシーバスを直撃する。<br><br>

