ネジレを抑える強化構造「ブレーディング X（BRAIDING X）」搭載の実力派シーバスロッド<br><br>

リールシートから元ガイド部にかけてブランク最外層をX状にカーボンテープで締め上げ、ネジレを抑える強化構造「ブレーディングX」を搭載したハイパフォーマンスシーバスロッド。またガイドへの糸絡みを自動的に解除するKガイドを搭載。さらにリングはオールSiCリング仕様で、PEライン使用時も快適なロッドワークが可能。このクラスでは初となるバチ抜け対応の極軟メガトップを搭載したモデル（86LL-Sのみ）もラインナップ。さらに、機能だけでなく、オリジナルリールシートに加えてレッド×ゴールドのアルマイトをグリップ周りにふんだんに配するなど、実釣性能と機能美の両立を追求。ベテランをも納得させるスペックを備えたクラス以上の実力派シリーズ。<br><br>

■全長(m)：2.74<br>
■継数(本)：2<br>
