頑丈さと独特の調子で人気を博したかつてのHRFロッドをブラッシュアップして生まれたHRF KJ（キジハタモデル）のDNAを受け継ぎ、とにかく軽さと操作性に磨きをかけた「軽くて強い」新生HRF。モンスタークラスのソイやアイナメが潜むHRFの本場である三陸、仙台湾、北海道にてテストを繰り返し、地元キーマンの意見を取り入れてこれまでにない快適な操作性を実現しながら、ネジレを抑制するダイワテクノジー「ブレーディングX」を搭載してパワフルなロッドに仕上げた。ライトリグを遠投するショアゲームから磯場での大物狙いまで、HRFの世界を自在に攻略するラインナップ。<br><br>

■81HB/ベイト<br>
1オンス以上のテキサスリグをメインに磯場で大物を相手にする為のガチンコROCKモデル。スローテーパーに仕上げたブランクはヘビーリグも快適に扱える調子。<br><br>

