クランキングでのどんなバイトをも絡めとるグラスロッドの特性とカーボンロッドのシャープな振り抜きと掛け感という相反する要素を両立するため、SVFグラスに高弾性HVFカーボンをコンポジット。これまで、クランクベイトロッドは二者択一の選択を迫られた。 カーボン素材ならではの、片手で軽快に振り抜ける軽さとキャストの正確性といった「快適な使用感」を優先するか、それともグラス素材特有の乗りの良さとファイト中のクッション性によるバラシにくさからなる「キャッチ率」を優先するか。またグラス素材は、タイニークランクからクランク全般を1本で幅広く扱える懐の深さも魅力。661MLFB-Gは片手でも軽く振り抜けるほど軽く、バイトしてきたバスは確実に乗せ、遠距離でのバイトでもフックを貫通させバラシにくいのはもちろんの事、ティップの先端までX45で締め上げてロッドブランクのネジレを極限まで抑える事でグラスコンポジットロッドにも関わらずキャストが決まる。「キャストフィールはカーボン、リトリーブから乗せるまではグラス」の理想をかつてないレベルで実現し、従来のグラスコンポジットロッドとは一線を画する仕上がりになっている。<br><br>

